(15, 163, 2, 0, 4, 'Quinn', 'Quinn', '<p>Queen wedding dress in satin and tulle with 3D flowers and crew neckline. Swarovski elements&nbsp;are applied on the crew neckline and flower details on the skirt and bodice.</p>\n', '<p>\n<style type=&quot;text/css&quot;>p.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 13.0px Helvetica; color: #333333; -webkit-text-stroke: #333333}\nspan.s1 {font-kerning: none}\n</style>\n</p>\n\n<p class=&quot;p1&quot;><span class=&quot;s1&quot;>По-настоящему королевское платье из атласа, прозрачной нежной сеточки&nbsp;с&nbsp;3D цветочными элементами и вырезом-лодочка. Орнамент из камней&nbsp;Swarovski &nbsp;идеально украшают горловину и цветы&nbsp;на юбке и корсете.</span></p>\n\n<p>&nbsp;</p>\n', 'quinn', 'quinn', 'a:36:{i:0;s:2:"38";i:1;s:2:"42";i:2;s:2:"43";i:3;s:2:"44";i:4;s:2:"45";i:5;s:2:"46";i:6;s:2:"47";i:7;s:2:"52";i:8;s:2:"53";i:9;s:2:"54";i:10;s:2:"55";i:11;s:2:"56";i:12;s:2:"57";i:13;s:2:"58";i:14;s:2:"59";i:15;s:2:"60";i:16;s:2:"61";i:17;s:2:"62";i:18;s:2:"63";i:19;s:2:"64";i:20;s:2:"49";i:21;s:2:"50";i:22;s:2:"51";i:23;s:2:"65";i:24;s:2:"66";i:25;s:2:"67";i:26;s:2:"68";i:27;s:2:"69";i:28;s:2:"70";i:29;s:2:"71";i:30;s:2:"74";i:31;s:2:"72";i:32;s:2:"75";i:33;s:2:"80";i:34;s:2:"82";i:35;s:2:"83";}', 'a:14:{i:0;s:2:"21";i:1;s:3:"171";i:2;s:3:"172";i:3;s:3:"182";i:4;s:3:"207";i:5;s:3:"211";i:6;s:3:"213";i:7;s:3:"217";i:8;s:3:"219";i:9;s:3:"221";i:10;s:3:"225";i:11;s:3:"230";i:12;s:3:"231";i:13;s:3:"232";}', 'a:36:{i:0;s:3:"177";i:1;s:3:"181";i:2;s:3:"183";i:3;s:3:"186";i:4;s:3:"187";i:5;s:3:"188";i:6;s:3:"189";i:7;s:3:"194";i:8;s:3:"195";i:9;s:3:"196";i:10;s:3:"197";i:11;s:3:"198";i:12;s:3:"199";i:13;s:3:"200";i:14;s:3:"201";i:15;s:3:"202";i:16;s:3:"203";i:17;s:3:"204";i:18;s:3:"205";i:19;s:3:"206";i:20;s:3:"191";i:21;s:3:"192";i:22;s:3:"193";i:23;s:3:"210";i:24;s:3:"212";i:25;s:3:"214";i:26;s:3:"215";i:27;s:3:"216";i:28;s:3:"218";i:29;s:3:"220";i:30;s:3:"223";i:31;s:3:"222";i:32;s:3:"226";i:33;s:3:"234";i:34;s:3:"238";i:35;s:3:"239";}', 'Quinn', '<p>\n<style type=&quot;text/css&quot;>p.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 13.0px Helvetica; color: #333333; -webkit-text-stroke: #333333}\nspan.s1 {font-kerning: none}\n</style>\n</p>\n\n<p class=&quot;p1&quot;><span class=&quot;s1&quot;>По-справжньому королівська сукня з атласу, сітки з&nbsp;3D квітковими елементами та вирізом-човник.Елегантна розшивка камінням Swarovski прикрашає горловину, квіти&nbsp;на спідниці та корсеті.&nbsp;</span></p>\n\n<p>&nbsp;</p>\n', 'quinn'),
(16, 163, 2, 0, 6, 'Mercedes', 'Mercedes', '<p>Chic transformer dress in satin with beaded&nbsp;lace appliques. Delicate lace runs down the detachable&nbsp;sleeves.&nbsp; Long satin train is decorated with embroidered lace stripes.&nbsp;</p>\n', '<p><span style=&quot;font-size: 13px;&quot;>Изысканное платье-трансформер со съемными&nbsp;рукавами из атласа и превосходно&nbsp;расшитым вручную кружева. Длинный&nbsp;атласный шлейф декорирован расшитыми кружевными аппликациями.</span></p>\n\n<p>&nbsp;</p>\n', 'mercedes', 'mercedes', 'a:36:{i:0;s:2:"38";i:1;s:2:"42";i:2;s:2:"43";i:3;s:2:"44";i:4;s:2:"45";i:5;s:2:"46";i:6;s:2:"47";i:7;s:2:"52";i:8;s:2:"53";i:9;s:2:"54";i:10;s:2:"55";i:11;s:2:"56";i:12;s:2:"57";i:13;s:2:"58";i:14;s:2:"59";i:15;s:2:"60";i:16;s:2:"61";i:17;s:2:"62";i:18;s:2:"63";i:19;s:2:"64";i:20;s:2:"49";i:21;s:2:"50";i:22;s:2:"51";i:23;s:2:"65";i:24;s:2:"66";i:25;s:2:"67";i:26;s:2:"68";i:27;s:2:"69";i:28;s:2:"70";i:29;s:2:"71";i:30;s:2:"74";i:31;s:2:"72";i:32;s:2:"75";i:33;s:2:"80";i:34;s:2:"82";i:35;s:2:"83";}', 'a:14:{i:0;s:2:"21";i:1;s:3:"171";i:2;s:3:"172";i:3;s:3:"182";i:4;s:3:"207";i:5;s:3:"211";i:6;s:3:"213";i:7;s:3:"217";i:8;s:3:"219";i:9;s:3:"221";i:10;s:3:"225";i:11;s:3:"230";i:12;s:3:"231";i:13;s:3:"232";}', 'a:36:{i:0;s:3:"177";i:1;s:3:"181";i:2;s:3:"183";i:3;s:3:"186";i:4;s:3:"187";i:5;s:3:"188";i:6;s:3:"189";i:7;s:3:"194";i:8;s:3:"195";i:9;s:3:"196";i:10;s:3:"197";i:11;s:3:"198";i:12;s:3:"199";i:13;s:3:"200";i:14;s:3:"201";i:15;s:3:"202";i:16;s:3:"203";i:17;s:3:"204";i:18;s:3:"205";i:19;s:3:"206";i:20;s:3:"191";i:21;s:3:"192";i:22;s:3:"193";i:23;s:3:"210";i:24;s:3:"212";i:25;s:3:"214";i:26;s:3:"215";i:27;s:3:"216";i:28;s:3:"218";i:29;s:3:"220";i:30;s:3:"223";i:31;s:3:"222";i:32;s:3:"226";i:33;s:3:"234";i:34;s:3:"238";i:35;s:3:"239";}', 'Mercedes', '<p><span style=&quot;font-size: 13px;&quot;>Вишукана сукня-трансформер з причіпними рукавами, виготовлена з атласу та вручну розшитим мереживом. &nbsp; Довгий атласний шлейф задекорований &nbsp;мереживними аплікаціями.&nbsp;</span></p>\n\n<p>&nbsp;</p>\n', 'mercedes'),
(17, 163, 2, 0, 0, 'Jade', 'Jade', '<p>Marvelous vintage dress in &nbsp;lace with a small train and overhanging top fits absolutely every body type. Beading on the sleeves, top and neckline adds a special chic to it. Deep cut back makes the dress look even more elegant.&nbsp;</p>\n', '<p>\n<style type=&quot;text/css&quot;>p.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 13.0px Helvetica; color: #333333; -webkit-text-stroke: #333333}\nspan.s1 {font-kerning: none}\n</style>\n</p>\n\n<p class=&quot;p1&quot;><span class=&quot;s1&quot;>Чудесное винтажное платье с напуском изготовлено из эксклюзивного кружева, имеет классический небольшой шлейф и &nbsp;идеально подходит&nbsp;&nbsp;для любой фигуры. Вышивка стеклярусом&nbsp;&nbsp;рукавов, топа&nbsp;и горловины&nbsp;добавляет особый шик, а углубленный вырез на спинке делает платье очень элегантным.&nbsp;</span></p>\n', 'jade', 'jade', 'a:36:{i:0;s:2:"38";i:1;s:2:"42";i:2;s:2:"43";i:3;s:2:"44";i:4;s:2:"45";i:5;s:2:"46";i:6;s:2:"47";i:7;s:2:"52";i:8;s:2:"53";i:9;s:2:"54";i:10;s:2:"55";i:11;s:2:"56";i:12;s:2:"57";i:13;s:2:"58";i:14;s:2:"59";i:15;s:2:"60";i:16;s:2:"61";i:17;s:2:"62";i:18;s:2:"63";i:19;s:2:"64";i:20;s:2:"49";i:21;s:2:"50";i:22;s:2:"51";i:23;s:2:"65";i:24;s:2:"66";i:25;s:2:"67";i:26;s:2:"68";i:27;s:2:"69";i:28;s:2:"70";i:29;s:2:"71";i:30;s:2:"74";i:31;s:2:"72";i:32;s:2:"75";i:33;s:2:"80";i:34;s:2:"82";i:35;s:2:"83";}', 'a:14:{i:0;s:2:"21";i:1;s:3:"171";i:2;s:3:"172";i:3;s:3:"182";i:4;s:3:"207";i:5;s:3:"211";i:6;s:3:"213";i:7;s:3:"217";i:8;s:3:"219";i:9;s:3:"221";i:10;s:3:"225";i:11;s:3:"230";i:12;s:3:"231";i:13;s:3:"232";}', 'a:36:{i:0;s:3:"177";i:1;s:3:"181";i:2;s:3:"183";i:3;s:3:"186";i:4;s:3:"187";i:5;s:3:"188";i:6;s:3:"189";i:7;s:3:"194";i:8;s:3:"195";i:9;s:3:"196";i:10;s:3:"197";i:11;s:3:"198";i:12;s:3:"199";i:13;s:3:"200";i:14;s:3:"201";i:15;s:3:"202";i:16;s:3:"203";i:17;s:3:"204";i:18;s:3:"205";i:19;s:3:"206";i:20;s:3:"191";i:21;s:3:"192";i:22;s:3:"193";i:23;s:3:"210";i:24;s:3:"212";i:25;s:3:"214";i:26;s:3:"215";i:27;s:3:"216";i:28;s:3:"218";i:29;s:3:"220";i:30;s:3:"223";i:31;s:3:"222";i:32;s:3:"226";i:33;s:3:"234";i:34;s:3:"238";i:35;s:3:"239";}', 'Jade', '<p>\n<style type=&quot;text/css&quot;>p.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 13.0px Helvetica; color: #333333; -webkit-text-stroke: #333333}\nspan.s1 {font-kerning: none}\n</style>\n</p>\n\n<p class=&quot;p1&quot;><span class=&quot;s1&quot;>Чудесна вінтажна сукня з напуском виготовлена з ексклюзивного мережива, має класичний невеличкий шлейф та &nbsp;ідеально виглядає на будь-якій фігурі. Розшивка на рукавах, топі та горловині додає особливого шарму, а поглиблений виріз на спині робить сукню надзвичайно елегантною.</span></p>\n', 'jade'),
(18, 163, 2, 0, 15, 'Adelynn', 'Adelynn', '<p>Beautiful princess wedding dress with a tulle skirt and beautiful &nbsp;flower lace. Crew neckline with an illusion net lays perfectly over the shoulders.&nbsp;</p>\n', '<p><span style=&quot;font-size: 13px;&quot;>Удивительное пудровое&nbsp;платье с&nbsp;юбкой из фатина и непревзойденным цветочным кружевом.</span></p>\n\n<p>&nbsp;</p>\n', 'adelynn', 'adelynn', 'a:36:{i:0;s:2:"38";i:1;s:2:"42";i:2;s:2:"43";i:3;s:2:"44";i:4;s:2:"45";i:5;s:2:"46";i:6;s:2:"47";i:7;s:2:"52";i:8;s:2:"53";i:9;s:2:"54";i:10;s:2:"55";i:11;s:2:"56";i:12;s:2:"57";i:13;s:2:"58";i:14;s:2:"59";i:15;s:2:"60";i:16;s:2:"61";i:17;s:2:"62";i:18;s:2:"63";i:19;s:2:"64";i:20;s:2:"49";i:21;s:2:"50";i:22;s:2:"51";i:23;s:2:"65";i:24;s:2:"66";i:25;s:2:"67";i:26;s:2:"68";i:27;s:2:"69";i:28;s:2:"70";i:29;s:2:"71";i:30;s:2:"74";i:31;s:2:"72";i:32;s:2:"75";i:33;s:2:"80";i:34;s:2:"82";i:35;s:2:"83";}', 'a:14:{i:0;s:2:"21";i:1;s:3:"171";i:2;s:3:"172";i:3;s:3:"182";i:4;s:3:"207";i:5;s:3:"211";i:6;s:3:"213";i:7;s:3:"217";i:8;s:3:"219";i:9;s:3:"221";i:10;s:3:"225";i:11;s:3:"230";i:12;s:3:"231";i:13;s:3:"232";}', 'a:36:{i:0;s:3:"177";i:1;s:3:"181";i:2;s:3:"183";i:3;s:3:"186";i:4;s:3:"187";i:5;s:3:"188";i:6;s:3:"189";i:7;s:3:"194";i:8;s:3:"195";i:9;s:3:"196";i:10;s:3:"197";i:11;s:3:"198";i:12;s:3:"199";i:13;s:3:"200";i:14;s:3:"201";i:15;s:3:"202";i:16;s:3:"203";i:17;s:3:"204";i:18;s:3:"205";i:19;s:3:"206";i:20;s:3:"191";i:21;s:3:"192";i:22;s:3:"193";i:23;s:3:"210";i:24;s:3:"212";i:25;s:3:"214";i:26;s:3:"215";i:27;s:3:"216";i:28;s:3:"218";i:29;s:3:"220";i:30;s:3:"223";i:31;s:3:"222";i:32;s:3:"226";i:33;s:3:"234";i:34;s:3:"238";i:35;s:3:"239";}', 'Adelynn', '<p><span style=&quot;font-size: 13px;&quot;>Дивовижна сукня з фатиновою спідницею&nbsp;та неперевершеним квітковим мереживом. Виріз човником гарно підкреслює&nbsp;декольте. &nbsp;</span></p>\n\n<p>&nbsp;</p>\n', 'adelynn'),
(19, 163, 2, 0, 9, 'Gvinet', 'Gvinet', '<p>All-over lace vintage dress with an over-hanging bodice ideally accentuates the waist. Crew neckline edged with a beautiful lace&nbsp; shows-off the shoulders in a very feminine manner.&nbsp;</p>\n', '<p><span style=&quot;font-size: 13px;&quot;>Кружевное винтажное платье с напуском на талии. Вырез лодочкой&nbsp;&nbsp;подчеркивает женственную и нежную линию плеч. &nbsp;&nbsp;</span></p>\n\n<p>&nbsp;</p>\n', 'gvinet', 'gvinet', 'a:36:{i:0;s:2:"38";i:1;s:2:"42";i:2;s:2:"43";i:3;s:2:"44";i:4;s:2:"45";i:5;s:2:"46";i:6;s:2:"47";i:7;s:2:"52";i:8;s:2:"53";i:9;s:2:"54";i:10;s:2:"55";i:11;s:2:"56";i:12;s:2:"57";i:13;s:2:"58";i:14;s:2:"59";i:15;s:2:"60";i:16;s:2:"61";i:17;s:2:"62";i:18;s:2:"63";i:19;s:2:"64";i:20;s:2:"49";i:21;s:2:"50";i:22;s:2:"51";i:23;s:2:"65";i:24;s:2:"66";i:25;s:2:"67";i:26;s:2:"68";i:27;s:2:"69";i:28;s:2:"70";i:29;s:2:"71";i:30;s:2:"74";i:31;s:2:"72";i:32;s:2:"75";i:33;s:2:"80";i:34;s:2:"82";i:35;s:2:"83";}', 'a:14:{i:0;s:2:"21";i:1;s:3:"171";i:2;s:3:"172";i:3;s:3:"182";i:4;s:3:"207";i:5;s:3:"211";i:6;s:3:"213";i:7;s:3:"217";i:8;s:3:"219";i:9;s:3:"221";i:10;s:3:"225";i:11;s:3:"230";i:12;s:3:"231";i:13;s:3:"232";}', 'a:36:{i:0;s:3:"177";i:1;s:3:"181";i:2;s:3:"183";i:3;s:3:"186";i:4;s:3:"187";i:5;s:3:"188";i:6;s:3:"189";i:7;s:3:"194";i:8;s:3:"195";i:9;s:3:"196";i:10;s:3:"197";i:11;s:3:"198";i:12;s:3:"199";i:13;s:3:"200";i:14;s:3:"201";i:15;s:3:"202";i:16;s:3:"203";i:17;s:3:"204";i:18;s:3:"205";i:19;s:3:"206";i:20;s:3:"191";i:21;s:3:"192";i:22;s:3:"193";i:23;s:3:"210";i:24;s:3:"212";i:25;s:3:"214";i:26;s:3:"215";i:27;s:3:"216";i:28;s:3:"218";i:29;s:3:"220";i:30;s:3:"223";i:31;s:3:"222";i:32;s:3:"226";i:33;s:3:"234";i:34;s:3:"238";i:35;s:3:"239";}', 'Gvinet', '<p><span style=&quot;font-size: 13px;&quot;>Мереживна вінтажна сукня з напуском на талії. Виріз човником виглядає&nbsp;жіночно та елегантно.</span></p>\n\n<p>&nbsp;</p>\n', 'gvinet'),
(20, 163, 2, 0, 10, 'Josephina', 'Josephina', '<p>Sophisticated A-line wedding dress with a full skirt in satin and decorated with lace and gemstone embroidery. Queen-like train in lace and satin makes this dress even more special.&nbsp;</p>\n', '<p><span style=&quot;font-size: 13px;&quot;>Изящное кружевное платье А-силуэта&nbsp;с атласной основой прекрасно дополненое расшитыми вручную&nbsp;камнями Swarovski. По-настоящему королевский шлейф&nbsp; делает это платье еще более изысканным.&nbsp;</span></p>\n\n<p>&nbsp;</p>\n', 'josephina', 'josephina', 'a:36:{i:0;s:2:"38";i:1;s:2:"42";i:2;s:2:"43";i:3;s:2:"44";i:4;s:2:"45";i:5;s:2:"46";i:6;s:2:"47";i:7;s:2:"52";i:8;s:2:"53";i:9;s:2:"54";i:10;s:2:"55";i:11;s:2:"56";i:12;s:2:"57";i:13;s:2:"58";i:14;s:2:"59";i:15;s:2:"60";i:16;s:2:"61";i:17;s:2:"62";i:18;s:2:"63";i:19;s:2:"64";i:20;s:2:"49";i:21;s:2:"50";i:22;s:2:"51";i:23;s:2:"65";i:24;s:2:"66";i:25;s:2:"67";i:26;s:2:"68";i:27;s:2:"69";i:28;s:2:"70";i:29;s:2:"71";i:30;s:2:"74";i:31;s:2:"72";i:32;s:2:"75";i:33;s:2:"80";i:34;s:2:"82";i:35;s:2:"83";}', 'a:14:{i:0;s:2:"21";i:1;s:3:"171";i:2;s:3:"172";i:3;s:3:"182";i:4;s:3:"207";i:5;s:3:"211";i:6;s:3:"213";i:7;s:3:"217";i:8;s:3:"219";i:9;s:3:"221";i:10;s:3:"225";i:11;s:3:"230";i:12;s:3:"231";i:13;s:3:"232";}', 'a:36:{i:0;s:3:"177";i:1;s:3:"181";i:2;s:3:"183";i:3;s:3:"186";i:4;s:3:"187";i:5;s:3:"188";i:6;s:3:"189";i:7;s:3:"194";i:8;s:3:"195";i:9;s:3:"196";i:10;s:3:"197";i:11;s:3:"198";i:12;s:3:"199";i:13;s:3:"200";i:14;s:3:"201";i:15;s:3:"202";i:16;s:3:"203";i:17;s:3:"204";i:18;s:3:"205";i:19;s:3:"206";i:20;s:3:"191";i:21;s:3:"192";i:22;s:3:"193";i:23;s:3:"210";i:24;s:3:"212";i:25;s:3:"214";i:26;s:3:"215";i:27;s:3:"216";i:28;s:3:"218";i:29;s:3:"220";i:30;s:3:"223";i:31;s:3:"222";i:32;s:3:"226";i:33;s:3:"234";i:34;s:3:"238";i:35;s:3:"239";}', 'Josephina', '<p><span style=&quot;font-size: 13px;&quot;>Витончена мереживна сукня А-силуету з атласною основою&nbsp;&nbsp;задекорована камінням Swarovski. По-справжньому&nbsp; королівський шлейф&nbsp;робить цю сукню ще більш особливою.</span></p>\n\n<p>&nbsp;</p>\n', 'josephina'),
(21, 163, 2, 0, 11, 'Lorenza', 'Lorenza', '<p>Gorgeous wedding dress with a sweetheart-neckline, full skirt and delicate lace. &nbsp;Light beading decorates the bodice and sleeves.&nbsp;</p>\n', '<p><span style=&quot;font-size: 13px;&quot;>Несравненное свадебное платье с сердцеобразным вырезом, пышной юбкой и деликатным кружевом. Нежная вышивка&nbsp;изящно украшает корсет и рукава.</span></p>\n\n<p>&nbsp;</p>\n', 'lorenza', 'lorenza', 'a:36:{i:0;s:2:"38";i:1;s:2:"42";i:2;s:2:"43";i:3;s:2:"44";i:4;s:2:"45";i:5;s:2:"46";i:6;s:2:"47";i:7;s:2:"52";i:8;s:2:"53";i:9;s:2:"54";i:10;s:2:"55";i:11;s:2:"56";i:12;s:2:"57";i:13;s:2:"58";i:14;s:2:"59";i:15;s:2:"60";i:16;s:2:"61";i:17;s:2:"62";i:18;s:2:"63";i:19;s:2:"64";i:20;s:2:"49";i:21;s:2:"50";i:22;s:2:"51";i:23;s:2:"65";i:24;s:2:"66";i:25;s:2:"67";i:26;s:2:"68";i:27;s:2:"69";i:28;s:2:"70";i:29;s:2:"71";i:30;s:2:"74";i:31;s:2:"72";i:32;s:2:"75";i:33;s:2:"80";i:34;s:2:"82";i:35;s:2:"83";}', 'a:14:{i:0;s:2:"21";i:1;s:3:"171";i:2;s:3:"172";i:3;s:3:"182";i:4;s:3:"207";i:5;s:3:"211";i:6;s:3:"213";i:7;s:3:"217";i:8;s:3:"219";i:9;s:3:"221";i:10;s:3:"225";i:11;s:3:"230";i:12;s:3:"231";i:13;s:3:"232";}', 'a:36:{i:0;s:3:"177";i:1;s:3:"181";i:2;s:3:"183";i:3;s:3:"186";i:4;s:3:"187";i:5;s:3:"188";i:6;s:3:"189";i:7;s:3:"194";i:8;s:3:"195";i:9;s:3:"196";i:10;s:3:"197";i:11;s:3:"198";i:12;s:3:"199";i:13;s:3:"200";i:14;s:3:"201";i:15;s:3:"202";i:16;s:3:"203";i:17;s:3:"204";i:18;s:3:"205";i:19;s:3:"206";i:20;s:3:"191";i:21;s:3:"192";i:22;s:3:"193";i:23;s:3:"210";i:24;s:3:"212";i:25;s:3:"214";i:26;s:3:"215";i:27;s:3:"216";i:28;s:3:"218";i:29;s:3:"220";i:30;s:3:"223";i:31;s:3:"222";i:32;s:3:"226";i:33;s:3:"234";i:34;s:3:"238";i:35;s:3:"239";}', 'Lorenza', '<p><span style=&quot;font-size: 13px;&quot;>&nbsp;Незрівнянна весільна сукня з вирізом &ldquo;сердечко&rdquo;, пишною спідницею та делікатним мереживом.&nbsp; Ніжна розшивка витончено прикрашає корсет та рукави.&nbsp;</span></p>\n\n<p>&nbsp;</p>\n', 'lorenza'),
(22, 163, 2, 0, 8, 'Sesille', 'Sesille', '<p>Transformer mermaid dress in tulle and lace with a detachable tulle train. &nbsp;Elongated bodice perfectly hugs the hips showing-off the curves. Tulle train hemmed with lace details makes the look even more romantic.</p>\n', '<p><span style=&quot;font-size: 13px;&quot;>Платье трансформер в стиле &quot;рыбка&quot; со съемным&nbsp;шлейфом из тюля и кружевными аппликациями. Удлиненный корсет идеально облегает&nbsp;бедра,&nbsp;прекрасно подчеркивая фигуру. Съемный&nbsp;шлейф украшенный кружевными деталями добавляет романтическую нотку в образ.</span></p>\n\n<p>&nbsp;</p>\n', 'sesille', 'sesille', 'a:36:{i:0;s:2:"38";i:1;s:2:"42";i:2;s:2:"43";i:3;s:2:"44";i:4;s:2:"45";i:5;s:2:"46";i:6;s:2:"47";i:7;s:2:"52";i:8;s:2:"53";i:9;s:2:"54";i:10;s:2:"55";i:11;s:2:"56";i:12;s:2:"57";i:13;s:2:"58";i:14;s:2:"59";i:15;s:2:"60";i:16;s:2:"61";i:17;s:2:"62";i:18;s:2:"63";i:19;s:2:"64";i:20;s:2:"49";i:21;s:2:"50";i:22;s:2:"51";i:23;s:2:"65";i:24;s:2:"66";i:25;s:2:"67";i:26;s:2:"68";i:27;s:2:"69";i:28;s:2:"70";i:29;s:2:"71";i:30;s:2:"74";i:31;s:2:"72";i:32;s:2:"75";i:33;s:2:"80";i:34;s:2:"82";i:35;s:2:"83";}', 'a:14:{i:0;s:2:"21";i:1;s:3:"171";i:2;s:3:"172";i:3;s:3:"182";i:4;s:3:"207";i:5;s:3:"211";i:6;s:3:"213";i:7;s:3:"217";i:8;s:3:"219";i:9;s:3:"221";i:10;s:3:"225";i:11;s:3:"230";i:12;s:3:"231";i:13;s:3:"232";}', 'a:36:{i:0;s:3:"177";i:1;s:3:"181";i:2;s:3:"183";i:3;s:3:"186";i:4;s:3:"187";i:5;s:3:"188";i:6;s:3:"189";i:7;s:3:"194";i:8;s:3:"195";i:9;s:3:"196";i:10;s:3:"197";i:11;s:3:"198";i:12;s:3:"199";i:13;s:3:"200";i:14;s:3:"201";i:15;s:3:"202";i:16;s:3:"203";i:17;s:3:"204";i:18;s:3:"205";i:19;s:3:"206";i:20;s:3:"191";i:21;s:3:"192";i:22;s:3:"193";i:23;s:3:"210";i:24;s:3:"212";i:25;s:3:"214";i:26;s:3:"215";i:27;s:3:"216";i:28;s:3:"218";i:29;s:3:"220";i:30;s:3:"223";i:31;s:3:"222";i:32;s:3:"226";i:33;s:3:"234";i:34;s:3:"238";i:35;s:3:"239";}', 'Sesille', '<p><span style=&quot;font-size: 13px;&quot;>Сукня трансформер у стилі &ldquo;рибка&rdquo; зі знімним&nbsp;шлейфом з фатину&nbsp;і мереживними аплікаціями. Подовжений корсет ідеально прилягає до бедр гарно підкреслюючи фігуру. Знімний&nbsp;шлейф оздоблений мереживними&nbsp;деталями додає романтичну нотку до образу.&nbsp;</span></p>\n\n<p>&nbsp;</p>\n', 'sesille'),
(23, 163, 2, 0, 14, 'Vallery', 'Vallery', '<p>Lace mermaid dress with satin sweetheart. Plunging V-back with sophisticated beading decoration.&nbsp;</p>\n', '<p><span style=&quot;font-size: 13px;&quot;>Кружевное платье в стиле &quot;рыбка&quot;. Сердцевидный вырез горловины подчеркивает нежный образ невесты.Утонченно-глубокий&nbsp;вырез на спине, украшенный изящными элементами расшитыми вручную бисером.</span></p>\n\n<p>&nbsp;</p>\n', 'vallery', 'vallery', 'a:36:{i:0;s:2:"38";i:1;s:2:"42";i:2;s:2:"43";i:3;s:2:"44";i:4;s:2:"45";i:5;s:2:"46";i:6;s:2:"47";i:7;s:2:"52";i:8;s:2:"53";i:9;s:2:"54";i:10;s:2:"55";i:11;s:2:"56";i:12;s:2:"57";i:13;s:2:"58";i:14;s:2:"59";i:15;s:2:"60";i:16;s:2:"61";i:17;s:2:"62";i:18;s:2:"63";i:19;s:2:"64";i:20;s:2:"49";i:21;s:2:"50";i:22;s:2:"51";i:23;s:2:"65";i:24;s:2:"66";i:25;s:2:"67";i:26;s:2:"68";i:27;s:2:"69";i:28;s:2:"70";i:29;s:2:"71";i:30;s:2:"74";i:31;s:2:"72";i:32;s:2:"75";i:33;s:2:"80";i:34;s:2:"82";i:35;s:2:"83";}', 'a:14:{i:0;s:2:"21";i:1;s:3:"171";i:2;s:3:"172";i:3;s:3:"182";i:4;s:3:"207";i:5;s:3:"211";i:6;s:3:"213";i:7;s:3:"217";i:8;s:3:"219";i:9;s:3:"221";i:10;s:3:"225";i:11;s:3:"230";i:12;s:3:"231";i:13;s:3:"232";}', 'a:36:{i:0;s:3:"177";i:1;s:3:"181";i:2;s:3:"183";i:3;s:3:"186";i:4;s:3:"187";i:5;s:3:"188";i:6;s:3:"189";i:7;s:3:"194";i:8;s:3:"195";i:9;s:3:"196";i:10;s:3:"197";i:11;s:3:"198";i:12;s:3:"199";i:13;s:3:"200";i:14;s:3:"201";i:15;s:3:"202";i:16;s:3:"203";i:17;s:3:"204";i:18;s:3:"205";i:19;s:3:"206";i:20;s:3:"191";i:21;s:3:"192";i:22;s:3:"193";i:23;s:3:"210";i:24;s:3:"212";i:25;s:3:"214";i:26;s:3:"215";i:27;s:3:"216";i:28;s:3:"218";i:29;s:3:"220";i:30;s:3:"223";i:31;s:3:"222";i:32;s:3:"226";i:33;s:3:"234";i:34;s:3:"238";i:35;s:3:"239";}', 'Vallery', '<p><span style=&quot;font-size: 13px;&quot;>Мереживна сукня у стилі &ldquo;рибка&rdquo;. Атлас на горловині має серцеподібний виріз.Витончений-глибокий виріз на спинці прикрашено &nbsp;деталями вручну розшитими бісером.&nbsp;</span></p>\n\n<p>&nbsp;</p>\n', 'vallery'),
