(88, 163, 2, 0, 3, 'Vanessa', 'Vanessa', '<p>Gorgeous lace mermaid transformer dress with an attachable tulle train. Dress perfectly hugs the hips showing-off the curves.&nbsp; Skin colour net on the back, sleeves and neckline creates a second-skin illusion.&nbsp;</p>\n', '<p>\n<style type=&quot;text/css&quot;>p.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 13.0px Helvetica; color: #333333; -webkit-text-stroke: #333333}\nspan.s1 {font-kerning: none}\n</style>\n</p>\n\n<p class=&quot;p1&quot;><span class=&quot;s1&quot;>Фантастическое кружевное платье-трансформер &nbsp;силуэта&nbsp;&nbsp;&quot;рыбка&quot; с отстегивающимся&nbsp;шлейфом из фатина.&nbsp;Рукава, спинка&nbsp;и вырез на горловине&nbsp;украшены сеткой телесного цвета с кружевными деталями</span></p>\n\n<p>&nbsp;</p>\n', 'vanessa', 'vanessa', 'a:36:{i:0;s:2:"38";i:1;s:2:"42";i:2;s:2:"43";i:3;s:2:"44";i:4;s:2:"45";i:5;s:2:"46";i:6;s:2:"47";i:7;s:2:"52";i:8;s:2:"53";i:9;s:2:"54";i:10;s:2:"55";i:11;s:2:"56";i:12;s:2:"57";i:13;s:2:"58";i:14;s:2:"59";i:15;s:2:"60";i:16;s:2:"61";i:17;s:2:"62";i:18;s:2:"63";i:19;s:2:"64";i:20;s:2:"49";i:21;s:2:"50";i:22;s:2:"51";i:23;s:2:"65";i:24;s:2:"66";i:25;s:2:"67";i:26;s:2:"68";i:27;s:2:"69";i:28;s:2:"70";i:29;s:2:"71";i:30;s:2:"74";i:31;s:2:"72";i:32;s:2:"75";i:33;s:2:"80";i:34;s:2:"82";i:35;s:2:"83";}', 'a:14:{i:0;s:2:"21";i:1;s:3:"171";i:2;s:3:"172";i:3;s:3:"182";i:4;s:3:"207";i:5;s:3:"211";i:6;s:3:"213";i:7;s:3:"217";i:8;s:3:"219";i:9;s:3:"221";i:10;s:3:"225";i:11;s:3:"230";i:12;s:3:"231";i:13;s:3:"232";}', 'a:36:{i:0;s:3:"177";i:1;s:3:"181";i:2;s:3:"183";i:3;s:3:"186";i:4;s:3:"187";i:5;s:3:"188";i:6;s:3:"189";i:7;s:3:"194";i:8;s:3:"195";i:9;s:3:"196";i:10;s:3:"197";i:11;s:3:"198";i:12;s:3:"199";i:13;s:3:"200";i:14;s:3:"201";i:15;s:3:"202";i:16;s:3:"203";i:17;s:3:"204";i:18;s:3:"205";i:19;s:3:"206";i:20;s:3:"191";i:21;s:3:"192";i:22;s:3:"193";i:23;s:3:"210";i:24;s:3:"212";i:25;s:3:"214";i:26;s:3:"215";i:27;s:3:"216";i:28;s:3:"218";i:29;s:3:"220";i:30;s:3:"223";i:31;s:3:"222";i:32;s:3:"226";i:33;s:3:"234";i:34;s:3:"238";i:35;s:3:"239";}', 'Vanessa', '<p>\n<style type=&quot;text/css&quot;>p.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 13.0px Helvetica; color: #333333; -webkit-text-stroke: #333333}\nspan.s1 {font-kerning: none}\n</style>\n</p>\n\n<p class=&quot;p1&quot;><span class=&quot;s1&quot;>Фантастична мереживна сукня-трансформер силуету &ldquo;рибка&rdquo; з причепним шлейфом з фатину. Сукня ідеально підкреслює фігуру. Рукави, спинку&nbsp;та горловину прикрашає тілесна сіточка з мереживними деталями.</span></p>\n\n<p>&nbsp;</p>\n', 'vanessa'),
(89, 163, 2, 0, 7, 'Magnolia', 'Magnolia', '<p>A-line transformer dress in satin and lace.&nbsp; Extra bolero with 3-D flowers and Swarovski elements. Same flowers used on a gorgeous extra skirt that perfectly finishes the dress.&nbsp;</p>\n', '<p><span style=&quot;font-size: 13px;&quot;>Платье-трансформер А-силуэта&nbsp;из атласа и кружева. Дополнительная накидка с 3-D цветами и камнями Swarovski. Такие же цветочные элементы украшают дополнительную юбку, которая идеально завершает образ платья.</span></p>\n\n<p>&nbsp;</p>\n', 'magnolia', 'magnolia', 'a:36:{i:0;s:2:"38";i:1;s:2:"42";i:2;s:2:"43";i:3;s:2:"44";i:4;s:2:"45";i:5;s:2:"46";i:6;s:2:"47";i:7;s:2:"52";i:8;s:2:"53";i:9;s:2:"54";i:10;s:2:"55";i:11;s:2:"56";i:12;s:2:"57";i:13;s:2:"58";i:14;s:2:"59";i:15;s:2:"60";i:16;s:2:"61";i:17;s:2:"62";i:18;s:2:"63";i:19;s:2:"64";i:20;s:2:"49";i:21;s:2:"50";i:22;s:2:"51";i:23;s:2:"65";i:24;s:2:"66";i:25;s:2:"67";i:26;s:2:"68";i:27;s:2:"69";i:28;s:2:"70";i:29;s:2:"71";i:30;s:2:"74";i:31;s:2:"72";i:32;s:2:"75";i:33;s:2:"80";i:34;s:2:"82";i:35;s:2:"83";}', 'a:14:{i:0;s:2:"21";i:1;s:3:"171";i:2;s:3:"172";i:3;s:3:"182";i:4;s:3:"207";i:5;s:3:"211";i:6;s:3:"213";i:7;s:3:"217";i:8;s:3:"219";i:9;s:3:"221";i:10;s:3:"225";i:11;s:3:"230";i:12;s:3:"231";i:13;s:3:"232";}', 'a:36:{i:0;s:3:"177";i:1;s:3:"181";i:2;s:3:"183";i:3;s:3:"186";i:4;s:3:"187";i:5;s:3:"188";i:6;s:3:"189";i:7;s:3:"194";i:8;s:3:"195";i:9;s:3:"196";i:10;s:3:"197";i:11;s:3:"198";i:12;s:3:"199";i:13;s:3:"200";i:14;s:3:"201";i:15;s:3:"202";i:16;s:3:"203";i:17;s:3:"204";i:18;s:3:"205";i:19;s:3:"206";i:20;s:3:"191";i:21;s:3:"192";i:22;s:3:"193";i:23;s:3:"210";i:24;s:3:"212";i:25;s:3:"214";i:26;s:3:"215";i:27;s:3:"216";i:28;s:3:"218";i:29;s:3:"220";i:30;s:3:"223";i:31;s:3:"222";i:32;s:3:"226";i:33;s:3:"234";i:34;s:3:"238";i:35;s:3:"239";}', 'Magnolia', '<p><span style=&quot;font-size: 13px;&quot;>Сукня-трансформер А силуету з атласу і мережива. Додаткова накидка з 3-D квітами та камінням Swarovski. Такі ж квіткові елементи п