(107, 163, 2, 0, 1, 'Martina', 'Martina', '<p>\n<style type=&quot;text/css&quot;>p.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px &#39;Helvetica Neue&#39;; color: #454545}\np.p2 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px &#39;Helvetica Neue&#39;; color: #e4af0a}\nspan.s1 {text-decoration: underline}\n</style>\n</p>\n\n<p>Absolutely stunning vintage transformer dress with extra bolero and tulle skirt. &nbsp;Split sleeves decorated with gemstones make this dress very unique. &nbsp;Also available in ivory.&nbsp;</p>\n', '<p>&nbsp;Удивительно легкое платье-трансформер в стиле boho с &nbsp;болеро и фатиновою юбкой. Рукава с разрезами, украшенные ручной вышивкой , добавляют уникальности целому ансамблю. Также доступное в цвете айвори.</p>\n\n<p>&nbsp;</p>\n', 'martina', 'martina', 'a:36:{i:0;s:2:"38";i:1;s:2:"42";i:2;s:2:"43";i:3;s:2:"44";i:4;s:2:"45";i:5;s:2:"46";i:6;s:2:"47";i:7;s:2:"52";i:8;s:2:"53";i:9;s:2:"54";i:10;s:2:"55";i:11;s:2:"56";i:12;s:2:"57";i:13;s:2:"58";i:14;s:2:"59";i:15;s:2:"60";i:16;s:2:"61";i:17;s:2:"62";i:18;s:2:"63";i:19;s:2:"64";i:20;s:2:"49";i:21;s:2:"50";i:22;s:2:"51";i:23;s:2:"65";i:24;s:2:"66";i:25;s:2:"67";i:26;s:2:"68";i:27;s:2:"69";i:28;s:2:"70";i:29;s:2:"71";i:30;s:2:"74";i:31;s:2:"72";i:32;s:2:"75";i:33;s:2:"80";i:34;s:2:"82";i:35;s:2:"83";}', 'a:14:{i:0;s:2:"21";i:1;s:3:"171";i:2;s:3:"172";i:3;s:3:"182";i:4;s:3:"207";i:5;s:3:"211";i:6;s:3:"213";i:7;s:3:"217";i:8;s:3:"219";i:9;s:3:"221";i:10;s:3:"225";i:11;s:3:"230";i:12;s:3:"231";i:13;s:3:"232";}', 'a:36:{i:0;s:3:"177";i:1;s:3:"181";i:2;s:3:"183";i:3;s:3:"186";i:4;s:3:"187";i:5;s:3:"188";i:6;s:3:"189";i:7;s:3:"194";i:8;s:3:"195";i:9;s:3:"196";i:10;s:3:"197";i:11;s:3:"198";i:12;s:3:"199";i:13;s:3:"200";i:14;s:3:"201";i:15;s:3:"202";i:16;s:3:"203";i:17;s:3:"204";i:18;s:3:"205";i:19;s:3:"206";i:20;s:3:"191";i:21;s:3:"192";i:22;s:3:"193";i:23;s:3:"210";i:24;s:3:"212";i:25;s:3:"214";i:26;s:3:"215";i:27;s:3:"216";i:28;s:3:"218";i:29;s:3:"220";i:30;s:3:"223";i:31;s:3:"222";i:32;s:3:"226";i:33;s:3:"234";i:34;s:3:"238";i:35;s:3:"239";}', 'Martina', '<p>Надзвичайно легка сукня-трансформер в стилі boho з болеро та фатиновою спідничкою. Рукави з розрізами, прикрашені розшивкою, додають унікальності цілому ансамблю. Також доступна&nbsp; в кольорі айворі.&nbsp;</p>\n', 'martina'),
(109, 163, 2, 0, 22, 'Renee', 'Renee', '<p>Soft tulle dress with a beautiful floral lace. Crew neckline decorated with a light beading.&nbsp;</p>\n', '<p>Платье из мягкого фатина и вставкой из цветочного кружева. Вырез лодочкой украшен нежной вышивкой.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n', 'renee', 'renee', 'a:36:{i:0;s:2:"38";i:1;s:2:"42";i:2;s:2:"43";i:3;s:2:"44";i:4;s:2:"45";i:5;s:2:"46";i:6;s:2:"47";i:7;s:2:"52";i:8;s:2:"53";i:9;s:2:"54";i:10;s:2:"55";i:11;s:2:"56";i:12;s:2:"57";i:13;s:2:"58";i:14;s:2:"59";i:15;s:2:"60";i:16;s:2:"61";i:17;s:2:"62";i:18;s:2:"63";i:19;s:2:"64";i:20;s:2:"49";i:21;s:2:"50";i:22;s:2:"51";i:23;s:2:"65";i:24;s:2:"66";i:25;s:2:"67";i:26;s:2:"68";i:27;s:2:"69";i:28;s:2:"70";i:29;s:2:"71";i:30;s:2:"74";i:31;s:2:"72";i:32;s:2:"75";i:33;s:2:"80";i:34;s:2:"82";i:35;s:2:"83";}', 'a:14:{i:0;s:2:"21";i:1;s:3:"171";i:2;s:3:"172";i:3;s:3:"182";i:4;s:3:"207";i:5;s:3:"211";i:6;s:3:"213";i:7;s:3:"217";i:8;s:3:"219";i:9;s:3:"221";i:10;s:3:"225";i:11;s:3:"230";i:12;s:3:"231";i:13;s:3:"232";}', 'a:36:{i:0;s:3:"177";i:1;s:3:"181";i:2;s:3:"183";i:3;s:3:"186";i:4;s:3:"187";i:5;s:3:"188";i:6;s:3:"189";i:7;s:3:"194";i:8;s:3:"195";i:9;s:3:"196";i:10;s:3:"197";i:11;s:3:"198";i:12;s:3:"199";i:13;s:3:"200";i:14;s:3:"201";i:15;s:3:"202";i:16;s:3:"203";i:17;s:3:"204";i:18;s:3:"205";i:19;s:3:"206";i:20;s:3:"191";i:21;s:3:"192";i:22;s:3:"193";i:23;s:3:"210";i:24;s:3:"212";i:25;s:3:"214";i:26;s:3:"215";i:27;s:3:"216";i:28;s:3:"218";i:29;s:3:"220";i:30;s:3:"223";i:31;s:3:"222";i:32;s:3:"226";i:33;s:3:"234";i:34;s:3:"238";i:35;s:3:"239";}', 'Renne', '<p>Сукня з м&rsquo;якого фатину та вставкою з квіткового мережива. Виріз човником прикрашений ніжною розшивкою.</p>\n\n<p>&nbsp;</p>\n', 'renne'),
(111, 163, 2, 0, 24, 'Belynda', 'Belynda', '<p>Tulle ball gown with a full skirt. Tulle&nbsp; sweetheart neckline is decorated with a gorgeous beaded lace appliqu&eacute; that creates a necklace effect.</p>\n\n<p>&nbsp;</p>\n', '<p>Фатиновое платье с пышной юбкой. Декольте &nbsp;в форме сердца украшено расшитой кружевной аппликацией, которая создает эффект подвески.</p>\n', 'belynda', 'belynda', 'a:36:{i:0;s:2:"38";i:1;s:2:"42";i:2;s:2:"43";i:3;s:2:"44";i:4;s:2:"45";i:5;s:2:"46";i:6;s:2:"47";i:7;s:2:"52";i:8;s:2:"53";i:9;s:2:"54";i:10;s:2:"55";i:11;s:2:"56";i:12;s:2:"57";i:13;s:2:"58";i:14;s:2:"59";i:15;s:2:"60";i:16;s:2:"61";i:17;s:2:"62";i:18;s:2:"63";i:19;s:2:"64";i:20;s:2:"49";i:21;s:2:"50";i:22;s:2:"51";i:23;s:2:"65";i:24;s:2:"66";i:25;s:2:"67";i:26;s:2:"68";i:27;s:2:"69";i:28;s:2:"70";i:29;s:2:"71";i:30;s:2:"74";i:31;s:2:"72";i:32;s:2:"75";i:33;s:2:"80";i:34;s:2:"82";i:35;s:2:"83";}', 'a:14:{i:0;s:2:"21";i:1;s:3:"171";i:2;s:3:"172";i:3;s:3:"182";i:4;s:3:"207";i:5;s:3:"211";i:6;s:3:"213";i:7;s:3:"217";i:8;s:3:"219";i:9;s:3:"221";i:10;s:3:"225";i:11;s:3:"230";i:12;s:3:"231";i:13;s:3:"232";}', 'a:36:{i:0;s:3:"177";i:1;s:3:"181";i:2;s:3:"183";i:3;s:3:"186";i:4;s:3:"187";i:5;s:3:"188";i:6;s:3:"189";i:7;s:3:"194";i:8;s:3:"195";i:9;s:3:"196";i:10;s:3:"197";i:11;s:3:"198";i:12;s:3:"199";i:13;s:3:"200";i:14;s:3:"201";i:15;s:3:"202";i:16;s:3:"203";i:17;s:3:"204";i:18;s:3:"205";i:19;s:3:"206";i:20;s:3:"191";i:21;s:3:"192";i:22;s:3:"193";i:23;s:3:"210";i:24;s:3:"212";i:25;s:3:"214";i:26;s:3:"215";i:27;s:3:"216";i:28;s:3:"218";i:29;s:3:"220";i:30;s:3:"223";i:31;s:3:"222";i:32;s:3:"226";i:33;s:3:"234";i:34;s:3:"238";i:35;s:3:"239";}', 'Belynda', '<p>Фатинова сукня з пишною спідницею. Декольте у формі серця прикрашене розшитою мереживною аплікацією, яка створює ефект підвіски.</p>\n\n<p>&nbsp;</p>\n', 'belynda'),
(112, 163, 2, 0, 16, 'Kendall', 'Kendall', '<p>Transformer wedding dress with a tulle skirt and lace bodice. Extra bolero with floral lace and a narrow sash perfectly finishes the look. The back is decorated with 3-D flower elements.&nbsp;</p>\n', '<p>Платье трансформер с фатиновою юбкой и кружевным корсетом. Болеро с цветочным кружевом и узкий поясок идеально завершают ансамбль. Спинка задекорированы 3-D цветочными элементами.</p>\n', 'kendall', 'kendall', 'a:36:{i:0;s:2:"38";i:1;s:2:"42";i:2;s:2:"43";i:3;s:2:"44";i:4;s:2:"45";i:5;s:2:"46";i:6;s:2:"47";i:7;s:2:"52";i:8;s:2:"53";i:9;s:2:"54";i:10;s:2:"55";i:11;s:2:"56";i:12;s:2:"57";i:13;s:2:"58";i:14;s:2:"59";i:15;s:2:"60";i:16;s:2:"61";i:17;s:2:"62";i:18;s:2:"63";i:19;s:2:"64";i:20;s:2:"49";i:21;s:2:"50";i:22;s:2:"51";i:23;s:2:"65";i:24;s:2:"66";i:25;s:2:"67";i:26;s:2:"68";i:27;s:2:"69";i:28;s:2:"70";i:29;s:2:"71";i:30;s:2:"74";i:31;s:2:"72";i:32;s:2:"75";i:33;s:2:"80";i:34;s:2:"82";i:35;s:2:"83";}', 'a:14:{i:0;s:2:"21";i:1;s:3:"171";i:2;s:3:"172";i:3;s:3:"182";i:4;s:3:"207";i:5;s:3:"211";i:6;s:3:"213";i:7;s:3:"217";i:8;s:3:"219";i:9;s:3:"221";i:10;s:3:"225";i:11;s:3:"230";i:12;s:3:"231";i:13;s:3:"232";}', 'a:36:{i:0;s:3:"177";i:1;s:3:"181";i:2;s:3:"183";i:3;s:3:"186";i:4;s:3:"187";i:5;s:3:"188";i:6;s:3:"189";i:7;s:3:"194";i:8;s:3:"195";i:9;s:3:"196";i:10;s:3:"197";i:11;s:3:"198";i:12;s:3:"199";i:13;s:3:"200";i:14;s:3:"201";i:15;s:3:"202";i:16;s:3:"203";i:17;s:3:"204";i:18;s:3:"205";i:19;s:3:"206";i:20;s:3:"191";i:21;s:3:"192";i:22;s:3:"193";i:23;s:3:"210";i:24;s:3:"212";i:25;s:3:"214";i:26;s:3:"215";i:27;s:3:"216";i:28;s:3:"218";i:29;s:3:"220";i:30;s:3:"223";i:31;s:3:"222";i:32;s:3:"226";i:33;s:3:"234";i:34;s:3:"238";i:35;s:3:"239";}', 'Kendall', '<p>Сукня трансформер з фатиновою спідничкою та мереживним корсетом. Болеро з квітковим мереживом та вузенький поясок ідеально завершують образ. Спинка задекорована 3-D квітковими елементами.&nbsp;</p>\n', 'kendall'),
(113, 163, 2, 0, 20, 'Lydia', 'Lydia', '<p>Classic wedding dress with the tulle skirt and lace bodice. Narrow sash beautifully accentuates the waist. Crew neckline is decorated with a soft beading.&nbsp;</p>\n', '<p>Классическое свадебное платье с фатиновою юбкой и кружевным корсетом. Узкий пояс красиво подчеркивает талию. Вырез лодочкой украшен нежной вышивкой.</p>\n\n<p><br />\n​</p>\n', 'lydia', 'lydia', 'a:36:{i:0;s:2:"38";i:1;s:2:"42";i:2;s:2:"43";i:3;s:2:"44";i:4;s:2:"45";i:5;s:2:"46";i:6;s:2:"47";i:7;s:2:"52";i:8;s:2:"53";i:9;s:2:"54";i:10;s:2:"55";i:11;s:2:"56";i:12;s:2:"57";i:13;s:2:"58";i:14;s:2:"59";i:15;s:2:"60";i:16;s:2:"61";i:17;s:2:"62";i:18;s:2:"63";i:19;s:2:"64";i:20;s:2:"49";i:21;s:2:"50";i:22;s:2:"51";i:23;s:2:"65";i:24;s:2:"66";i:25;s:2:"67";i:26;s:2:"68";i:27;s:2:"69";i:28;s:2:"70";i:29;s:2:"71";i:30;s:2:"74";i:31;s:2:"72";i:32;s:2:"75";i:33;s:2:"80";i:34;s:2:"82";i:35;s:2:"83";}', 'a:14:{i:0;s:2:"21";i:1;s:3:"171";i:2;s:3:"172";i:3;s:3:"182";i:4;s:3:"207";i:5;s:3:"211";i:6;s:3:"213";i:7;s:3:"217";i:8;s:3:"219";i:9;s:3:"221";i:10;s:3:"225";i:11;s:3:"230";i:12;s:3:"231";i:13;s:3:"232";}', 'a:36:{i:0;s:3:"177";i:1;s:3:"181";i:2;s:3:"183";i:3;s:3:"186";i:4;s:3:"187";i:5;s:3:"188";i:6;s:3:"189";i:7;s:3:"194";i:8;s:3:"195";i:9;s:3:"196";i:10;s:3:"197";i:11;s:3:"198";i:12;s:3:"199";i:13;s:3:"200";i:14;s:3:"201";i:15;s:3:"202";i:16;s:3:"203";i:17;s:3:"204";i:18;s:3:"205";i:19;s:3:"206";i:20;s:3:"191";i:21;s:3:"192";i:22;s:3:"193";i:23;s:3:"210";i:24;s:3:"212";i:25;s:3:"214";i:26;s:3:"215";i:27;s:3:"216";i:28;s:3:"218";i:29;s:3:"220";i:30;s:3:"223";i:31;s:3:"222";i:32;s:3:"226";i:33;s:3:"234";i:34;s:3:"238";i:35;s:3:"239";}', 'Lydia', '<p>Класична весільна сукня з фатиновою спідничкою та мереживним корсетом. Вузенький пояс гарно підкреслює талію. Виріз човником прикрашений ніжною розшивкою.</p>\n\n<p><br />\n​</p>\n', 'lydia'),
