(119, 163, 2, 0, 23, 'Deni', 'Deni', '<p>Straight transformer dress in satin and lace with an attachable satin train. Extra train beautifully finishes the look.</p>\n\n<p>&nbsp;</p>\n', '<p>Прямое платье-трансформер из атласа и кружева со съемным &nbsp;атласным шлейфом.</p>\n\n<p>&nbsp;</p>\n', 'deni', 'deni', 'a:36:{i:0;s:2:"38";i:1;s:2:"42";i:2;s:2:"43";i:3;s:2:"44";i:4;s:2:"45";i:5;s:2:"46";i:6;s:2:"47";i:7;s:2:"52";i:8;s:2:"53";i:9;s:2:"54";i:10;s:2:"55";i:11;s:2:"56";i:12;s:2:"57";i:13;s:2:"58";i:14;s:2:"59";i:15;s:2:"60";i:16;s:2:"61";i:17;s:2:"62";i:18;s:2:"63";i:19;s:2:"64";i:20;s:2:"49";i:21;s:2:"50";i:22;s:2:"51";i:23;s:2:"65";i:24;s:2:"66";i:25;s:2:"67";i:26;s:2:"68";i:27;s:2:"69";i:28;s:2:"70";i:29;s:2:"71";i:30;s:2:"74";i:31;s:2:"72";i:32;s:2:"75";i:33;s:2:"80";i:34;s:2:"82";i:35;s:2:"83";}', 'a:14:{i:0;s:2:"21";i:1;s:3:"171";i:2;s:3:"172";i:3;s:3:"182";i:4;s:3:"207";i:5;s:3:"211";i:6;s:3:"213";i:7;s:3:"217";i:8;s:3:"219";i:9;s:3:"221";i:10;s:3:"225";i:11;s:3:"230";i:12;s:3:"231";i:13;s:3:"232";}', 'a:36:{i:0;s:3:"177";i:1;s:3:"181";i:2;s:3:"183";i:3;s:3:"186";i:4;s:3:"187";i:5;s:3:"188";i:6;s:3:"189";i:7;s:3:"194";i:8;s:3:"195";i:9;s:3:"196";i:10;s:3:"197";i:11;s:3:"198";i:12;s:3:"199";i:13;s:3:"200";i:14;s:3:"201";i:15;s:3:"202";i:16;s:3:"203";i:17;s:3:"204";i:18;s:3:"205";i:19;s:3:"206";i:20;s:3:"191";i:21;s:3:"192";i:22;s:3:"193";i:23;s:3:"210";i:24;s:3:"212";i:25;s:3:"214";i:26;s:3:"215";i:27;s:3:"216";i:28;s:3:"218";i:29;s:3:"220";i:30;s:3:"223";i:31;s:3:"222";i:32;s:3:"226";i:33;s:3:"234";i:34;s:3:"238";i:35;s:3:"239";}', 'Deni', '<p>Пряма сукня-трансформер з атласу та мережива з відчіпним атласним шлейфом.&nbsp;</p>\n', 'deni'),
(121, 163, 2, 0, 2, 'Amanda', 'Amanda', '<p>Button down stylish lace transformer dress with an extra tulle skirt. &nbsp;Soft beading edges the neckline. &nbsp;Light tulle skirt makes the dress look very fairy.&nbsp;</p>\n', '<p>Стильное платье трансформер со съемной&nbsp;юбкой из фатина. Пуговицы на спине&nbsp;подчеркивают&nbsp;винтажный образ платья, а &nbsp;очень нежная вышивка украшает вырез.&nbsp;</p>\n\n<p>&nbsp;</p>\n', 'amanda', 'amanda', 'a:37:{i:0;s:2:"38";i:1;s:2:"42";i:2;s:2:"43";i:3;s:2:"44";i:4;s:2:"45";i:5;s:2:"46";i:6;s:2:"47";i:7;s:2:"52";i:8;s:2:"53";i:9;s:2:"54";i:10;s:2:"55";i:11;s:2:"56";i:12;s:2:"57";i:13;s:2:"58";i:14;s:2:"59";i:15;s:2:"60";i:16;s:2:"61";i:17;s:2:"62";i:18;s:2:"63";i:19;s:2:"64";i:20;s:2:"49";i:21;s:2:"50";i:22;s:2:"51";i:23;s:2:"65";i:24;s:2:"66";i:25;s:2:"67";i:26;s:2:"68";i:27;s:2:"69";i:28;s:2:"70";i:29;s:2:"71";i:30;s:2:"74";i:31;s:2:"72";i:32;s:2:"75";i:33;s:2:"80";i:34;s:2:"82";i:35;s:2:"89";i:36;s:2:"83";}', 'a:14:{i:0;s:2:"21";i:1;s:3:"171";i:2;s:3:"172";i:3;s:3:"182";i:4;s:3:"207";i:5;s:3:"211";i:6;s:3:"213";i:7;s:3:"217";i:8;s:3:"219";i:9;s:3:"221";i:10;s:3:"225";i:11;s:3:"230";i:12;s:3:"231";i:13;s:3:"232";}', 'a:37:{i:0;s:3:"177";i:1;s:3:"181";i:2;s:3:"183";i:3;s:3:"186";i:4;s:3:"187";i:5;s:3:"188";i:6;s:3:"189";i:7;s:3:"194";i:8;s:3:"195";i:9;s:3:"196";i:10;s:3:"197";i:11;s:3:"198";i:12;s:3:"199";i:13;s:3:"200";i:14;s:3:"201";i:15;s:3:"202";i:16;s:3:"203";i:17;s:3:"204";i:18;s:3:"205";i:19;s:3:"206";i:20;s:3:"191";i:21;s:3:"192";i:22;s:3:"193";i:23;s:3:"210";i:24;s:3:"212";i:25;s:3:"214";i:26;s:3:"215";i:27;s:3:"216";i:28;s:3:"218";i:29;s:3:"220";i:30;s:3:"223";i:31;s:3:"222";i:32;s:3:"226";i:33;s:3:"234";i:34;s:3:"238";i:35;s:3:"240";i:36;s:3:"239";}', 'Amanda', '<p>Стильна сукня трансформер зі знімною спідничкою з фатину. Ґудзики до низу сукні довершують вінтажний образ. Надзвичайно ніжна розшивка прикрашає виріз сукні.&nbsp;</p>\n', 'amanda');
