INSERT INTO `ko_component_article` (`component_id`, `menu_id`, `hidden`, `title_en`, `title_ru`, `text_en`, `text_ru`, `lat`, `lng`, `zoom`, `wide`, `shops`, `title_shop_en`, `title_shop_ru`, `address_en`, `address_ru`, `address_2_en`, `address_2_ru`, `phone`, `facebook`, `title_ua`, `text_ua`, `title_shop_ua`, `address_ua`, `address_2_ua`) VALUES
(17, 64, 0, '', '', '<h3 style=\\"color:#aaa;font-style:italic;\\">&nbsp; &nbsp; &nbsp;<span style=\\"font-size:14px;\\">Still a young company, TM Tanya Grig is gaining a significant&nbsp;bridal market recognition. Our guidline is to create interesting and&nbsp;&nbsp;stylish&nbsp;wedding gowns combining extraodinary and classical design&nbsp;decisions.</span></h3><h3 style=\\"color:#aaa;font-style:italic;\\">&nbsp; &nbsp; &nbsp; &quot;<span style=\\"font-size: 13px;\\"><span style=\\"font-size:14px;\\"><span style=\\"color:#A9A9A9;\\">Renessans&quot; (Renaissance) Bridal Shop and a design studio for unique bridal and evening gowns,&nbsp;was&nbsp;&nbsp;our first step&nbsp;to set up a successful company in 1999 in Ivano-Frankivsk city. Gradally, our styles started gaining attention of the &nbsp;leading Ukrainian bridal shops.&nbsp;</span></span></span><span style=\\"color: rgb(169, 169, 169); font-size: 14px;\\">Nowadays, our trademark is represented in the numerous shops in&nbsp;Ukraine, Russia, Belarus and the&nbsp;European Union.&nbsp;</span></h3><h3 style=\\"color:#aaa;font-style:italic;\\"><span style=\\"font-size:14px;\\"><span style=\\"color:#A9A9A9;\\">&nbsp; &nbsp; We aim at expanding new horizons with our partners. To keep up with the times,&nbsp;we are constantly improving the quality of our gowns&nbsp;as well as&nbsp;creating fresh and moden designs. We are doing our best&nbsp;to both,&nbsp;meet the challenging requirements of a high bridal fashion and&nbsp;&nbsp;make&nbsp;our customers&nbsp;satisfied.</span></span></h3>', '<h3 style=\\"color:#aaa;font-style:italic;\\"><span style=\\"font-size:12px;\\"><span style=\\"font-family:arial,helvetica,sans-serif;\\">Наша торговая марка молодая, но уже достаточно известная на свадебном рынке. Основным направлением ТМ Таня Григ является создание интересных, стильных свадебных нарядов, сочетающих традиционные, классические и нестандартные дизайнерские решения.</span></span></h3><h3 style=\\"color:#aaa;font-style:italic;\\"><span style=\\"font-size:12px;\\"><span style=\\"font-family:arial,helvetica,sans-serif;\\">Работа нашей фирмы началась в 1999г в городе Ивано-Франковске с открытия свадебного салона &laquo;Ренессанс&raquo; и дизайн-студии по изготовлению единичных свадебных и вечерних платьев для клиентов салона. Постепенно наши платья завоевали популярность ведущих салонов Украины.</span></span></h3><h3 style=\\"color:#aaa;font-style:italic;\\"><span style=\\"font-size:12px;\\"><span style=\\"font-family:arial,helvetica,sans-serif;\\">Сегодня наша торговая марка представлена во многих городах Украины,&nbsp;Беларуси, России&nbsp;и странах Евросоюза.</span></span></h3><h3 style=\\"color:#aaa;font-style:italic;\\"><span style=\\"font-size:12px;\\"><span style=\\"font-family:arial,helvetica,sans-serif;\\">В планах на будущее&mdash;расширение нашей географии. Чтобы идти в ногу со временем, мы год за годом повышаем качество своих изделий, разрабатываем новые дизайнерские идеи и внедряем лучшие из них. Мы стремимся не только соответствовать высоким стандартам свадебной моды, но и постоянно поднимать планку, радуя наших клиентов.</span></span></h3>', '', '', 0, 0, '', '', '', '', '', '', '', '', '', '', '<h3 style=\\"color:#aaa;font-style:italic;\\"><span style=\\"font-size:12px;\\">&nbsp;</span>&nbsp;<span style=\\"font-size:12px;\\">Наша торгова марка &nbsp;хоч і молода,&nbsp;але вже достатньо відома на весільному ринку. Основним напрямком TM Tanya Grig є створення цікавих та&nbsp;стильних весільних суконь, які поєднують традиційні та нестандартні дизайнерські рішення.</span></h3><h3 style=\\"color:#aaa;font-style:italic;\\"><span style=\\"font-size:12px;\\">&nbsp;Робота нашої фірми розпочалась в 1999 році в місті Івано-Франківськ з відкриття&nbsp;весільного салону &quot;Ренесанас&quot; і дизайн-студії з виготовлення &nbsp;весільних та вечірніх суконь для наших&nbsp;клієнтів. Поступово моделі &nbsp;суконь&nbsp;привертали увагу провідних&nbsp;весільних салонів України. &nbsp;На сьогодні наша торгова марка представлена в багатьох містах України, Білорусії, Росії та країнах Євросоюзу.</span></h3><h3 style=\\"color:#aaa;font-style:italic;\\"><span style=\\"font-size:12px;\\">&nbsp;&nbsp;У&nbsp;планах на майбутнє - розширення горизонтів наших представництв. Для того, щоб йти в ногу з часом &nbsp;ми з кожним роком покращуємо якість суконь та&nbsp;&nbsp;втілюємо в життя найцікавіші&nbsp;дизайнерські ідеї. Ми стараємося&nbsp;не лишень відповідати високим стандартам весільної моди, але й постійно піднімати рівень виробництва, щоб догодити&nbsp;нашим клієнтам.&nbsp;</span></h3><p>&nbsp;</p><style type=\\"text/css\\">p.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 14.0px Helvetica; color: #aaaaaa; -webkit-text-stroke: #aaaaaa}span.s1 {font-kerning: none}</style>', '', '', ''),
