(53, 87, 65, 'Diogo Nunes', 'diogo@sergiomatos.pt', '', '', '', 'Dear Sir or Madame We are a specialized shoe manufacturer in Portugal, with several years of experience and knowledge on any kind of constructions.  Using high quality products and workers with more than 20 years of experience make our handmade recognized by the most famous brands during all these years. Such brands as, Leon & Harper, AQA, Gerard Darel, Nozams, Nid de Guepes, amongst many others. Besides our presentation, we would like to invite you to visit and join us in some of your developments. Further information please feel free to contact meKindly regards,Diogo Nunes', 1480010071, 0),
(54, 87, 65, 'Sirli', 'Paalmann.Sirli@gmail.com', '', '', '', 'Hello!I fell in love with your Paulina dress (updated version from 2013 years model). Unfortunatelly it is above my budget (price is 938€ in Estonian bridal shop). Before I start looking for another dress I have to ask - is it possible to order dress directly from you and if it is possible than what is the price for Paulina?', 1480153560, 0);
