(6, 64, 0, 0, '', 1, 'Wedding dresses::Tanya Grig::Collection 2017::', '', '', '', ' &nbsp; &nbsp; &nbsp;Still a young company, TM Tanya Grig is gaining a significant&nbsp;bridal market recognition. Our guidline is to create interesting and&nbsp;&nbsp;stylish&nbsp;wedding gowns combining extraodinary and classical design&nbsp;decisions.&nbsp; &nbsp; &nbsp; &quot;Renessans&quot; (Renaissance) Bridal Shop and a design studio for', 'bridal, gowns, with, gaining, shops, design', 0, 1, 'Свадебные платья::Таня Григ дизайнер::Коллекция 2017', '', '', '', ' Наша торговая марка молодая, но уже достаточно известная на свадебном рынке. Основным направлением ТМ Таня Григ является создание интересных, стильных свадебных нарядов, сочетающих традиционные, классические и нестандартные дизайнерские решения.Работа нашей фирмы началась в 1999г в городе Ивано-Франковске с открытия свадебного салона', 'дизайнерские, салона, наша, свадебных, нашей, марка', 0, 1, 'Весільні сукні::Таня Гріг дизайнер::Колекція 2017', '', '', '', ' &nbsp;&nbsp;Наша торгова марка &nbsp;хоч і молода,&nbsp;але вже достатньо відома на весільному ринку. Основним напрямком TM Tanya Grig є створення цікавих та&nbsp;стильних весільних суконь, які поєднують традиційні та нестандартні дизайнерські рішення.&nbsp;Робота нашої фірми розпочалась в 1999 році в місті Івано-Франківськ з', '00px, суконь, дизайнерські, наша, торгова, весільних', 0),
